import React from 'react'
import {Container, Row, Button} from 'reactstrap';
import {NavLink, Link} from 'react-router-dom';

const nav_links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'tours',
    display:'Tours'
  },
]


const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          div.nav_
        </Row>
      </Container>
    </header>
  )
}

export default Header
